						["TX"] = "On the right side of her waist, on her upper thigh, Lyltiless possesse what looks to be an book in a protective silver casing. \n\nWhen it opens, a Arcane Quill usually springs to life from it, and either floats around Lylt like a pet, or scribbles things down.\n\n\n\nCan usually be seen floating behind her, and seems to be scribbling and recording everything. Sometimes it will quickly scribble things out.\n\nOccassionally, when the pages turn, they fade into Arcane dust, and gently flutter away, for about seven seconds. Before reassembling and shooting into the sky in an Arcane bolt.\n\n\\\\---------------------------------------//\n\nBow\n\nHer bow flickers with Arcane energy.\n\nThe snake heads on the ends are NOT IC. The rest is.\n\n",
