			["about"] = {
				["BK"] = 16,
				["T3"] = {
					["PH"] = {
						["TX"] = "With a brittle foundation ontop of her already petite Vulperan body, Tin suffers from a slightly stunted growth and weakened frame as a whole. Whilst not weak due to the abundant training practiced to compensate for her fragile bones, she remains skinny with thin but compact muscles. \n\nNumerous bumps beneath her coat of white fur indicates a history of breaking and setting bones, some of which poorly or hastily. She also has a large amount of smaller scars- both cuts and burns, lined with traces of fel... they seem recent. The largest of which is a hand-print across her forehead. \nShe is currently very, VERY pregnant!",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "Tin used to, until recently, be far more nervous in most- if not all things. Whilst still a worry-wart by nature, something seems to have tempered her resolve and mellowed her anxieties down to a resting concern and hesitation. \nShe is a seclusive soul- seldom seeking social gatherings or even company on her own accord, however she never refuses it either. Her mentality is that of not wanting to risk bothering others or push herself onto them. \n\"If I am wanted or needed, I assume I will be told so.\" ",
						["BK"] = 1,
					},
