				["T1"] = {
					["TX"] = "{img:Interface\\BlackMarket\\BlackMarketSign:256:128}\n{h2:c}Akidan, the Exiled{/h2}\n\n{col:9ffffd}An exile, it's easy to see that the Zandalari society had cast Akidan out.\nThe troll's sand-scoured skin carries the marks of an unforgiving sun, his body marred by malnutrition and withered thanks to a harsh life in Vol'dun.\n\nAkidan's eyes are sunken in their sockets, darkened by insomnia and veiled by unruly mop of dark blue hair that falls over his bleak, glowing gaze.\nHollow cheeks, pronounced cheekbones and a thin chin give him a slightly skeletal look, the features of his skull visible through his greyish-blue skin.\n\nA pair of short, smoothed-out tusks jut past the troll's dry, cracked lips that rarely curve to a smile. Strangely, his canine fangs seem oddly pronounced.\nProbably just a family trait or something equally inconsequential, right?",
