					["TX"] = "Sigrunn the Runt, as her name implies, is an orc lacking in height, muscle and fat, being little more than skin and bones. Her hair is of a dark, purple colour, and is long, greasy and poorly tended to.\n\nThe Runt sports a small, colourless tattoo of a void tendril on her right shoulder. On her belly, the symbol of the Fel Horde has been branded onto her skin, as has the crescent moon of the Shadowmoon clan on her back.\n\nThe clothes she wears, while not at all large by orcish standards, are still much too large for the little she-orc. Over these she wears a tabard sporting the symbol of the Illidari, no doubt intended for an orc much larger than she.\n\nHer staff, once little more than a mere stick, has undergone severe transformations due to its owner's use of void magic. Its colour has darkened, thorns have sprung, and strange flowers have bloomed. A fel orc's skull serves as the \"head\" of the staff, held in place by vines. As a weapon, it is accompanied by a simplistic ritual dagger carried on the necrolyte's hip.",
