			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{p:c}{img:Interface\\Pictures\\artifactbook-paladin-cover:128:128}{/p}\n{h3:c}PHYSICAL DESCRIPTION & PERSONALITY {/h3}\n\nRacket is about average height for a Goblin, her skin is a shade of light green, her eyes are deep blue and her hair is white with a slight tint of blonde. Usually Racket can be found wearing heavy plate armour which is white in colour with golden accents. For weapons she usually carries two heavy maces formed of crystals.  \n\nUnlike other Goblins, due to her upbringing by the Argent Dawn, Racket is a very selfless individual and always puts the needs others before herself. She is always ready to help anyone in need and fight anyone who would bring harm to her friends or others. \n\nAfter training with the Argent Dawn and Crusade, Racket has learned various fighting and healing techniques which make her a valuable asset to any team.\n\n\n{h3:c}A BEGGER & A PRIEST{/h3}\n\nI grew up alone, mostly I stayed in Ratchet. I would beg for scraps of food and gold…and well, I was quite obnoxiously loud in my begging so I was given the name “Racket” by the locals as everyone would say “What the hell is that loud racket?” every time I would beg. I tried my hand at pickpocketing once, I saw this Night Elf Priest being accompanied by two guards. “She MUST have money, she looks rich!” I thought to myself, so I went to pickpocket her and of course…I was caught red handed. Her guards drew their swords and I cowered in fear, but the Priest looked at me with her glowing elven eyes and raised her hand which caused the guards to sheathe their swords. She knelt down and looked at my torn and weathered clothing and then asked me “Would you like to join us; I can make sure you never go hungry again”. I had no idea who these people were, but I was desperate for food so I agreed. \n\nWe boarded a boat to the Eastern Kingdoms and the Priest, who told me her name was Elunaria Dawnbreeze, began to tell me all about the Argent Dawn. I listened intently as she gave me a bowl of soup and bread. I must have eaten at least five bowls as she told me about what it means to be a Priest in the Argent Dawn and what they do for the citizens of Azeroth. “That’s nice and all Elunaria”, I said, “but what can a small Goblin like me do for the Argent Dawn, I don’t have any skills!”. She smiled and rested her hand on my shoulders “The smallest acorn can grow to be the biggest tree”.\n\n\n{h3:c}JOURNEY INTO PRIESTHOOD{/h3}\n\nWhen we arrived at Lights Hope Chapel, I was amazed at what I saw. So many different races working together. Elunaria took me to one side and advised me that she would train me in the ways of being a Priest and teach me how to help people. Normally I would have laughed this off but there was something about her…I knew she could help me find my way in life. I was given a bath (my first one ever!), had my hair cut and was given fresh clothes. I was ready to start my training.\n\nI found the lessons and training on how to be a Priest very hard at first, finding it particularly hard to cast any form of healing spell. Elunaria always took the time to show me slowly what I needed to do and never scolded me when I made a mistake. I would often watch the Paladin’s training while reading books about the light, priesthood and the Argent Dawn. They all seemed to be able to focus the holy spells so easily AND they could use swords! I came to admire the Paladins, and often dreamt of maybe…just maybe, one day I could be one.\n\nAs time went on, I began to get a better understanding of the priesthood and began to advance in my healing spells. Secretly I would sneak out of my bed every night, take my wooden sword (which I had crudely made) and practice the fighting that I had seen the Paladin’s do. “Left, Right, Defend! Holy Light!” I would yell as I swung the sword, trying my best to cast one of the spells I saw the Paladin’s use…it never did work. You are probably wondering why I didn’t just ask if I could be a Paladin, I did try once and was told “Goblin’s have no place in being a Paladin” and then I was laughed at and told to get back to practice being a Priest.\n\n\n{h3:c}ATTACK ON LIGHT’S HOPE{/h3}\n\nAs the years continued, I became a full Priest and somewhat respected in the Argent Dawn. Elunaria had become a dear friend to me and she had become proud in the Priest that I had become. We were both in Light’s Hope Chapel healing the wounded when the bell atop the Chapel began to ring out with an almighty sound…the bell had never been rang, ever. We both rushed outside to see what was going on, and that’s when we saw them. Death Knights, Abominations, Ghouls and all other manner of Undead attacking the Chapel! Myself and Elunaria got to work, healing the wounded and using our spells as best we could to repel the undead. The fight wasn’t going well at all, I saw so many of the Argent Dawn die. A hulking abomination crashed into the side of the Chapel sending dust and debris everywhere, luckily the Chapel didn’t take too much damage but was still standing…but, I had lost Elunaria! I looked everywhere for her, I tried my best to fight my way through the relentless undead and that’s when I heard a voice say “…Ra…cket”.\n\nI looked down, and under a pile of undead corpses there was Elunaria, she was very badly injured. I couldn’t tell if the blood on the floor was hers or was from the corpses. I used all my might and pulled off the corpses and that’s when I saw them, two swords stabbed deep into her. I tried using every healing spell I knew to help her, but I could feel her slipping away. Her last words before she died were “Always be true to yourself…and be true to your heart”. I cried over her as she breathed her last breath, but I could hear the undead approaching. I felt a mixture of feelings and I wanted to lash out, to make the pain go away. I pulled out the two swords that had been in Elunaria, griped them tight and ran towards the oncoming undead. Watching the Paladin’s, all the training in secret…it all suddenly just clicked. I sliced undead, I fired holy power through my swords at the undead, I evaded attacks and I used the swords to defend against more brutal attacks. After what felt like an eternity, the fighting stopped. At the time I didn’t know why, but I was glad, I fell on my back and panted heavily as I was exhausted. \n\n\n{h3:c}A GOBLIN PALADIN?!{/h3}\n\nAfter the battle a meeting was held with all the members of the Argent Dawn, it was there we were all informed of the Argent Crusade, Tirion Fordring and the Ashbringer, the Death Knigths…everything. “We will take the fight to the Lich King; we will march on Ice Crown!” one of the Commanders announced. There was a lot of talking, planning and general discussions over the matter, but eventually a plan was agreed and the meeting (which had lasted several hours) was coming to a close. Before the meeting was to end there was a call for any further questions or requests. No one spoke up, but I stood took a deep breath and said once more “I wish to be a Paladin”. There were some gasps, and some laughter but the Commander raised his hand and called for silence. I continued “Elunaria, was my friend. She taught me all about the priesthood and all about the Argent Dawn. I always thought we saw each other as equals when it came to the light and serving Azerorth. I have watched the Paladin’s train; I know how to swing a sword which surely was evident today!”. There was more talking and nodding and then Captain Dominic Steele, one of the teachers of the Paladin’s, stood up and spoke “Since the day she arrived, Racket trained hard to become a Priest and she is a very competent Priest. She has the passion and the heart to be an even greater member of the Argent Crusade. I have seen her sneaking out at night and practicing Paladin techniques, and the skills she demonstrated today in the battlefield I would say it would be an injustice for her not to be trained!”. As the Captain took his seat there was a cheer from everyone, and I was finally given the chance to become a Paladin! \n\nMy training was given to me as the Crusade marched to Ice Crown, it was a particularly long journey. I impressed all of my Paladin teachers with my skills and knowledge, well I had been observing the Paladin’s for many years now! When we eventually made it to Ice Crown and set up camp, I was considered a Paladin, although I was still low ranking. As time went on, and the Ice Crown campaign continued, I became more and more skilled as a Paladin and I slowly climbed through the ranks and became respected among my fellow Paladins. When the time came to attack Ice Crown Citadel directly, I was eager to prove myself to the Crusade and I wanted to be part of the group to go deep into the Citadel. Though it was decided that I would remain at the entrance and heal the injured, at first, I thought this was an attempt to hold me back but I found out that they wanted my advance skills as a healer to help get troops back on their feet as soon as possible.\n\nAfter the fall of the Lich King, some of the Crusade stayed in Ice Crown to watch over the Citadel and surrounding areas. I journeyed back to Light’s Hope Chapel to get some much-needed rest. However, the Cataclysm came and I was sent out (along with a few other Paladin’s, Priests and other Argent Crusader members) to help aide the citizens of Azeroth. \n\n\n{h3:c}PANDARIA & THE LEGION INVASION {/h3}\n\nDuring the Pandaria campaign, the Argent Crusade took this time to continue to help with the recovery after the Cataclysm and some of us, including myself, journeyed to Pandaria to learn more of this new land and the ways of the Pandaren and Monks. I learnt quite a lot from the Pandaren, including new fighting techniques and new healing spells. \n\nWhen the Legion invaded and the great Tirion Fordring fell in battle, the Knights of the Silver Hand were reborn under a new Highlord and the Argent Crusade pledged themselves to this new order. I spent most of my time in Light’s Hope Chapel, training new Paladin’s and seeing to the needs of senior members of the order. I have never been one for glory, so I was more than happy to stay in the Chapel and assist where I can. \n\n\n{h3:c}THE COMING WAR {/h3}\n\nWith the renewed tension between the Alliance and Horde, it was decided that the Argent Crusade would send representatives to each city to closely observe how each faction was dealing with the inevitable upcoming war. I was tasked to journey to Orgrimmar, my first time every visiting the Horde. Before I left on my new mission, I was given new armour and weapons to help identify myself as a member of the Crusade. From what I have seen of Orgrimmar and the Horde so far raises a lot of questions and concerns but time will tell just how this war will play out. ",
