					{
						["TX"] = "{h1:c}Scout Ikech Blackburn{/h1}\n{h2:c}Scout, Tracker, Privateer, Musician {/h2}\n\n{col:ffffff}Some years ago, somewhere on the cost of Vuldun, Ikech was requested by his Caravan to locate and exterminate the \"giant fish/humanoid monsters\" that hunted his people. Ikech had decided to face this monster alone not wanting to risk the lives of his caravan family. He approached the cave and found the monster that had hunted his caravan for months. As he snuck up to the Murloc, he saw that it was not one but several Murlocs. Ikech ambushed their leader, but found there were to many Murlocs to fight alone. He lost not only his right eye but also started to suffer with Murlaphobia, the irrational fear of Murlocs. Ikech then reached into his sack and threw all his seafoam bombs at the horde of Murlocs. Out of his sense for adventure, Ikech then left his Caravan to explore as much of Azeroth as possible. Can often be found fighting the enemies of the horde and stealing their \"Shinies\"\n\nFinding a natural proficiency at scouting and tracking, Ikech joined the Horde war band.\n\nHas a cat called Chonkers, whom he loves. The City guard have warned him several times to take the cat to obedience training because he is grumpy.\n\n{h3:c}\"Don't ask me how i lost me eye; Giant. Fish. Monsters.\"{/h3}",
