				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}Gobolka Bearclaw{/h1}\n\nGobolka's past is a mystery. He doesn't talk too much. Until the need requires it he does not come down from the mountains. \n\nThe rumor says his family took the training of the young orc more seriously than usual. At a young age, along with his four brothers, their father ordered the youngsters to himself. They wandered on wolf's back for a week until they reached the mountain region. Then said the father: \"Who will reach the top of the summit first, will be able to take my place in the family and lead them\". It was a great honor for every orc. Then they began to climb to the peaks that plunged into the clouds... Hereupon it is not possible to know what happened. But the father found one of the boys with an axe in his back... Then found an other boy in a nearby valley fell from a height... The father climbed higher and found the third. In several places... From the clues he saw a direbear torn apart. He sought the fourth boy in vain, but he was disappeared. Nothing special, it is often happened at the family ritual. Winter was approaching in the mountains and the father went to home.\nAfter ten winters, a strange, haggard figure appeared in the village. Wrapped in old bearleather. Bear and wolf claws and fangs hung from him. He walked to the shaman of the village. Engraved bones full of runes thrown in front of the shaman. With no words. When the shaman saw it, bowed before the stranger with a frightened look. The Bear as suddenly came as he disappeared...\n\nSome said he was Gobolka, the missing boy.\n\nThey were seen him to appear during wars, helping the clan and the family with rage and elements.Then always disappeared without a trace between the mountains.",
