				["BK"] = 4,
				["T3"] = {
					["PH"] = {
						["TX"] = "Shotaro, or Sho how everyone calls him, is a short and Muscular looking Vulpera. Almost anytime you will see him, he will have his heavy armor on, with ax and shield ready to be used. His heavy armor does not allow you to see a single part of Sho´s body except his ears with few earrings in his left ear and with good light, you will be able to see his bright yellow eyes under his helmet. \n\nWhen you will get Sho to trust you and he will take off his helmet, you will be able to see his face, which is quite young and slightly feminine looking, it is visible that Sho is taking a lot of care with his fur, making sure it is clean and properly cut.\n\nIf you will be lucky enough, to see Sho without his armor on, you will be able to see his muscular body, with few scars on all parts of his body. But even the rest of his body is showing that Sho is taking care of himself, his fur is really soft and smells like roses. \n",
