		["0811181455QgoeD"] = {
			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "Very little is actually known about “Stinker”, what we do know has been pieced together from witness accounts and journal entries. It seems that Stinker was a young woman who was murdered and her body dumped and left to rot in what was once Lordaeron. As the years went on and Lordaeron became what is now known as the Undercity, her body continued to decay now being exposed to the infamous green goo in the Undercity. It seems that an aspiring “Scientist”, if he can even be called that, found her body and ran various experiments on her with the goal to create the ultimate forsaken soldier. Indeed the “Scientist” did succeed as Stinker has superior strength, but unfortunately years of rotting away has made her rather simple minded and stupid. From what we have read she has the following abilities and traits as results of experimentation – \n-    Increased Strength\n-    Plate armor fused to her body\n-    Powerful stench, most likely given to her before the experiments began…\nAlthough you would think such a creature would be violent and dangerous, this couldn’t be further from the truth, Stinker is very friendly. Just remember when approaching her, to be kind, gentle and don’t piss her off because she can probably crush every bone in your body…\nShe has a pet slime creature named “Slimer” and she also has a giant rat as her noble steed.\nExcerpts from the mysterious “Scientist’s” journal can be found in the History section\n",
						["BK"] = 1,
						["IC"] = "Ability_Creature_Poison_01",
					},
					["PS"] = {
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "Day 1\nMy goal is a simple one… to create a warrior of undeath, a warrior so strong that my Queen will desire more created… an Army of unkillable super warriors of…DEATH! But first I need a test subject, of course a willing subject would be best but needs must. I have found what appears to be the remains of a young woman, she is covered in all sorts of slime, rot and stink…\n\nDay 4\nThe stink…is unbearable! But I have finally started to experiment on this corpse, I am sure with the right chemicals, some electricity and some luck…this corpse will live again! \n\nDay 5\nSuccess! It lives! Odd though, it appears some of the slime that was deep inside the body has also become alive, not sure how that happened but an interesting result none the less! I have decided to call this new soldier “Stinker”, because well…she stinks and I really can’t be calling her “it” all the time. Stinker seems to love the reanimated slime creature, she has been calling it “Slimer”. Experimentation will continue, the next stage is increasing her strength so she can crush the Alliance…and maybe even the Horde? \nDay 10\nI feel as if I have used every single combination of chemicals, plants, tools…EVERYTHING and still Stinker isn’t any stronger than I am. I must admit, I took great pleasure in hearing Stinker scream as I experimented on her.\n\nDay 12\nFinally, I think I have done it! Using a combination of various chemicals and exposure to extreme electricity and heat, Stinker now has strength I have never seen before! She smashed a hole in one of my walls, good thing I am so deep underground that no one heard it, and she is too stupid to use her strength on me. What to do next…I wonder \n\nDay 23\nThe stupid brute Stinker! She was playing with a rat, I have no idea why, and she managed to chase the rat into my storage of precious chemicals covering herself and the rat in every single chemical I have! Well that’s just great, who knows what will happen now…If I have a giant mutant undead rat trying to eat me tonight I won’t be happy!\n\nDay 33\nSo, after days and days it seems the results of Stinker’s little “experiment” has bore fruit. The rat that was exposed to the chemicals has grown huge, big enough for Stinker to ride around my lab! And Stinker seems to have some kind of regenerative healing, I know this because well…I was bored and wanted to listen to her scream so I was cutting her to test her pain threshold, and each cut healed with in a matter of seconds! More experimentation is needed, how much can she regenerate\n\nDay 40\nInteresting results indeed. I have spent the last week exposing Stinker to all kinds of…tests, from dropping acid on her, to setting her on fire, and every time her skin heals itself…although it seems burns and missing limbs take a long time to regenerate. I think what is needed next is for Stinker to have some armour, something strong…something near indestructible…I know a few Dark Irons, I hear they are good at making such things…\n\nDay 58\nWell, it has been a while since I updated this book…So armour, well Stinker has some now …she has it forever. You see, I was advised by the Dark Irons that they had some very strong armour, near indestructible they said, but advised me in order for it to retain its strength it needs to be a tight fit to prevent anything getting in and affecting the armour…So you know what that meant right? Oh, this was a lot of fun…so much fun! I strapped the stupid Stinker down and my Dark Iron friend made the armour for me in my hideaway as the armour needed to still be red hot, and while still red hot the armour was placed directly onto Stinker…it burnt her skin, she cried out in pain (oh, what joy!) and due to her healing factor, the armour is now fused onto her, permanently. Yes, I think the time draws near for me to present her to my Queen and start work on the next one…and the next…\n\nDay 64\nWell, this is unexpected. I knew he was going to try something, just not this soon. Putress has been saying for sometime now he was going to act against both the Alliance and the Horde…but I didn’t expect this…they will be coming now, I need to escape… no one can find my experiments…Stinker and I will escape to somewhere safe and lay low…\n\nDay 67\nStinker is gone…the Undercity is full of Horde and Alliance, I have no idea where she went…There were a serious of explosions, shouting, screaming and she must have escaped with her stupid pet and that damn rat! They will be coming in any second now, there is no way out…or maybe there is…my notes…do I leave them or take them…\n",
						["BK"] = 1,
						["IC"] = "INV_Inscription_TomeOfTheClearMind",
					},
