					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Orcish Anthropologist",
						["IC"] = "achievement_alliedrace_magharorc",
						["TX"] = "This person would have extensive knowledge of the different cultures of clans of the orcs, down to the smallest of details and keeps notes of these.",
					},
				},
