				["T1"] = {
					["TX"] = "{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-ShadowmoonBurialGrounds:256:128}\n\n{p:c}{col:9A71FF}\"Perhaps one day you'll see them like I do.\"{/p}\n\n{col:ffffff}Anzuko is an oddity amongst the vulpera.\nUnnaturally calm, no matter the situation, lacking the overwhelming curiosity of most of his kin. He's commonly observed staring off into the distance or following people with his eerie pupiless eyes.\n\nHis fur isn't quite pure white, no - it's twinged with a lilac hue, a possible side-effect of his deep delve into the realm of shadow magicks. The patterns that show on his fur are almost too symmetrical to be natural.\nSleek, obsidian-polished claws protude from his fingertips.\n\nOther vulpera may know him as a hermit of the sands, rarely seeking companionship of others. On occasion, those curious about the magicks he wields, or those tormented by shadowy apparitions have sought him out for his expertise and guidance. Outside from those instances, he's lived alone.\n\nWhilst he might be eerie, using the shadows as he does, he is by no means malevolent nor driven insane by the whispers. Well, at least not yet.",
