				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "\"The Horde is my only clan.\"",
						["IC"] = "UI_HordeIcon",
						["TX"] = "Grekira bears no marks that would identify her as belonging to a particular clan, and actively shuns what she sees as the comfort of the weak.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "\"It's all she gave me and all I've ever needed.\"",
						["IC"] = "INV_Misc_Necklace_Beads04",
						["TX"] = "Grekira wears a simple cord around her neck hung with a variety of shiny pebbles. Whilst it is clearly of little monetary worth, it seems precious to her, and she often touches the stones when troubled or upset.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "\"There's more than one kind of strength.\"",
						["TX"] = "Grekira wears a wolf tail talisman at her belt no matter her current attire, usually the only ornamentation on her otherwise entirely practical clothing or armour.",
						["IC"] = "INV_Misc_MonsterTail_01",
					},
					["5"] = {
						["AC"] = false,
						["TI"] = "\"Storm, Earth and Fire - heed my call!\"",
						["IC"] = "crest_shaman",
						["TX"] = "Raised from birth with a deep reverence for the spirits of the elements by one who yearned to feel that connection once more, Grekira was always destined to be a shaman. \n\nHer warlike instincts soon asserted themselves however, and today she weilds both weapons and elemental power, calling upon the spirits to smite her enemies in the midst of combat.",
					},
					["4"] = {
						["AC"] = false,
						["TI"] = "\"Made by my own hand.\"",
						["IC"] = "INV_Archaeology_Ogres_Sorcerer_King_Toe_Ring",
						["TX"] = "Grekira wears a small collection of expertly crafted Orcish jewellery. Though the pieces are made from rustic materials, their intricate designs lend them a simple beauty.",
					},
				},
				["v"] = 45,
			},
			["time"] = 1603028133,
			["link"] = {
				["Grekira-ArgentDawn"] = 1,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PVPFrame\\Icons\\prestige-icon-3-3:128:128}{col:e5cc7f}Grekira is a young orc woman in the prime of her life, strong of limb with the thickset build common to females of her race, her skin the untainted ruddy brown of the Mag'har. She bears few scars but wears those she has with pride, never deigning to hide the marks of a warrior.\n\nAnd as a warrior is how she dresses, occasionally seen in functional furs and rough cloth but more often found wearing stout, well-crafted orcish armour, replete with spikes and skulls to intimidate her enemies and lend her an edge in combat. She eschews ornamentation, save for a necklace of four gleaming pebbles and the wolf tail talisman that forever hangs at her belt.\n\nGrekira 's raven dark hair is arranged into tight braids and pools with surprising elegance around her broad shoulders. Her face is angular, almost delicate in its defined contours, but it is her eyes that command the attention; wide, slightly slanted, and the gleaming gold of a wolf.\n\nSuch things mark Grekira out as something of a beauty by orcish standards, and a very respectable choice for a life-mate. But it is the question of her clan allegiance which obscures any good will her appearance might garner, and has dogged her progression through orcish society since the day she was born.\n\nBorn an orphan and raised by an elderly outcast, Grekira never had a place within the rigid clan structure of the orcs, and as such has never known that sense of belonging. And she has never wished to. As a shaman and warrior of notable skill, she has had offers in the past to be adopted into one clan or another, but she has always shunned all such overtures, embracing the moniker of ‘Clanless’ with pride. The Horde is her only home, the spirits her only kin; and that’s just the way she likes it.{/col}\n",
				},
