						["IC"] = "inv_misc_elitewyvernarmored",
						["TX"] = "Chazul is not your typical zandalari troll. He wears no ornaments, no beautifully crafted armor, no gold trinkets and  no tattoos, except for the useful runic ones.\n\nOn his chest, when bared, are what would seem vines or some sort of tattoos. What could they be?\n\nHe wears armour primarily made of leather. It looks sturdy enough but also very amateur - like. Almost if he just scrapped the pieces together himself.\nThe combat helmet he often is seen with will send shivers down human spines. That skull really does seem familiar...\n\nThe green and black combination makes him blend in with forest colours effortlessly.",
