				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Appearance",
						["TX"] = "Rahkira stands tall for an orcess, making her stand out more in groups. She is visibly aged, her skin both heavily scarred and wrinkling. Despite her age, she mantains an athletic physqiue. \n\nHer greyed violet hair reaches down towards her hips when untied and is decorated with various small bones. Currently, she has tied her hair back into a long ponytail, displaying the shaved sides of her head. Attached to the leather band holding her hair back are four large orange feathers. \n\nRahkira's ears hold a few piercings, two small pieces of bone pierce through the top of both of her ears. While stretching her ear lobes are two large fangs. ",
