					["TX"] = "Early Life: \n\nOnjuko lived most of her early life traveling with her Caravan in Vol'dun, she often spoke with the different people the caravan traded with always seeking more knowledge. \n\nWhen the war arrived in Vol'dun she became facinated by the different elves serving within the Horde especially the mages. This caused her to one day go up to a group of nightborne and ask (demand) if they could teach her some of their tricks. while they outright refused her.  she later sneaked intp one of their backpacks as they where teleporting back to Suramar. This act impressed the archanist who out of amusment decided to teach the Vulpera some of his tricks. The rest is history.",
