		["0929172828M95wp"] = {
			["zone"] = "Orgrimmar - Valley of Honor",
			["character"] = {
				["CU"] = "",
				["CO"] = "The Highblood Myrmidons are recruiting! Sin'dorei and Shal'dorei militia styled guild.\n\nArt in about!\n\n",
				["RP"] = 1,
