					["TX"] = "{link*https://imgur.com/a/i7JhJRA*A couple of references}\n{p:c}{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-91:64:64}{/p}\n{h1:c}{col:ff50a3}Gelkoo, the Katana of the Desert{/col}{/h1}\n{h2:c}{col:e03849}Appearance{/col}{/h2}\nThe primary fur color is a {col:bd2016}bright red ruby{/col} with some {col:614183}purple wine{/col} spots on the long ears and on the arms. The secondary color is a beautiful {col:ffffe0}alabaster white{/col} that covers most of his snout.\n\nThe sands of Vol'dun helped in keeping the fur condition absolutely perfect and clean, that is why as soon as he had the opportunity, he did not hesitate to roll over in.\n\nUnder the bandages he wears almost always, he hides the marks and scars he carries with him. On the chest it has a large scar, where the skin has a {col:ffa0e0}pale pink{/col} color on which the fur has no longer grown back. On his arms he hides what would look like bite and cuts marks.\n\nAfter the war he abandoned his heavy armor, and decided to keep a lighter one, preferring the Pandaria style, light and comfortable that allows wide movements.\n\n\n{h2:c}{col:13d5a9}Personality{/col}{/h2}\nwip\n\n{h2:c}{col:8271dc}Backstory{/col}{/h2}\nwip",
