						["TI"] = "Attire",
						["IC"] = "inv_chest_plate_pvppaladin_o_01",
						["TX"] = "A plate set as black as night, with the chestplate having the pandaren signs for 'Courageous Fortitude' painted on the black.\nWhile it is not the traditional attire for a Niuzao Sentinel, she still takes pride in serving her Celestial.",
