			["about"] = {
				["BK"] = 10,
				["T3"] = {
					["PH"] = {
						["IC"] = "achievement_character_pandaren_female",
						["BK"] = 3,
						["TX"] = "{col:5563b9}A female with average height, but a rather uncommon build for her kind. Unlike most of her kinswoman her hips are rather narrow in contrast to her broad shoulders and she generally lacks the staple chubbiness of her people. This in turn puts more emphasis on her well-toned muscles and her overall strong, brutish build, taking away some of her feminine qualities.\nHer fur is black as the moonless night sky which is contrasted by light grey, the dark parts creeping up on her arms and legs, breaking up into bigger spots going upward. The fur on both her arms and legs is dappled with small, white spots -- the remains of a serious injury.\n\nDespite her \"disadvantageous\" build she seems rather confident in her womanly charms, not at all afraid to show off what mother nature has given her. Apart from her rather large breasts which she is more than happy to flaunt if her current attire permits it she also visibly puts a lot of effort into her makeup -- her lips usually painted in a mulberry shade with additional black paint putting more emphasis on her facial markings, as well as her light brown eyes.\nHer face is overall pretty, albeit a tad slimmer than others' of her kind, matching her build.\n\nClaws are kept long and sharp, always ready to be used if the situation demands it.{/col}",
