					["TX"] = "Perched atop Khaltarr's head is a shock of bright red hair, caught between shades of orange and crimson, with visible tinges of blue at the roots to betray his natural colour. His facial features are angular and sharp, with particular attention to his beak of a nose, and his chin. Two large, pointed ears give no signs of nicks or cuts, and his mouth boasts two fully-formed, sharp tusks.\n\nHis blood-red eyes blend qualities of focus and and a hint of malice, complimenting how his face rests in a scowl. Most notably, his face is plastered with bright white face-paint, accented with a yellow outline. His teeth are slightly yellowed - the best kept a troll could possibly have.\n\nKhaltarr's form is fit - somewhere between lithe and wiry. His toned arms with ropey muscles usually on full display.\n\nGetting close enough to the troll to smell him would give away the scent of Zandalar flora mixed with his natural musk. He skulks as he walks, keeping a low and hunched profile.\n\nThe troll's legs are long, strong, and thick with muscle from a focus of jumps, rolls, kicks and flips. A red rope belt knots around his waist, the buckle sporting a large leaf against an orange background. Crudely lashed to this belt are a few pouches, some expelling exotic scents, some jingling with what can only be guessed as coins.\n\nHe walks with a measure of grace, but also a spring to compliment his bowed stance - caught between flowing steps and the bouncing trot of a long-legged bird. Like his hands, his feet are callused with tough skin.\n\n---\nMedals:\n{link*https://i.imgur.com/mL61Xzc.jpg*Medal of Notable Service} - Storm Peaks \"Weapons of Wonder\" Campaign\n{link*https://i.imgur.com/e6afhfE.jpg*Medal of Concord} - Silverpine Forest Campaign ",
				},
