			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}{icon:Ability_Hunter_SniperTraining:25}{/h1}\n\n{h2:c}{col:cacaca}[ {/col}{col:fa3f32}\"Grey Heron\"{/col}{col:cacaca} ]{/col}{/h2}\n\n{h3:c}{link*https://twitter.com/Shadoca_Art/status/1302268401671434241*Art by Shadoca}{/h3}\n\n{p:c}{col:ffffff}\nGrey Heron is an aging Pandaren whose body has visibly weathered life and its hardships. Every victory, every defeat, every memory has left one or another mark over the years. Her once smooth and walnut-brown fur now stands coarse and stained by gradients of grey all over her body. Wrinkles and dark circles adorn her eyes and her words roll over chapped lips. Despite all that Grey still teems with youthful determination, her scrutinizing lime gaze sharp and piercing as ever.\n{/col}{/p}\n\n\n\n\n\n",
