					["TX"] = "{img:Interface\\FlavorImages\\BloodElfLogo-small:256:256}\n\n{col:0fff20}-Background-\n\nBorn Ysi'rae Emberdawn, Ysi lost her parents during the sundering event, as well as her uncle and aunt. Being only young she was raised for a while by her Eldest cousin, who brought her under his wing, to a degree, and taught her best he could about life in general.\n\nAs she grew older Ysi went through several tutors for a mixture of life skills and her own education. Learning how to harness a supressed mixture of depression and anger she had held and to let it out in a healthy way as she was taught and trained in the ways of the Blood Mage. \n\nEvolving slowly through training and joinging forces with multiple groups and guilds, including the Sunreaver's, throughout her time she has become competent enough to manage assissting the horde as the events of the last few years have taken there toll on azeroth. She will never claim to play a big part, for most of the time she does not, but she has control enough to aid those that may require it and play some small part in the over all effort.{/col}\n\n \n\n",
