		["0106212415Q89ch"] = {
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Quick Glance ",
						["IC"] = "ACHIEVEMENT_BOSS_GRANDMAGUSTELESTRA",
						["TX"] = "Rae is a conventionally attractive woman, with clearly defined feminine features. \n\nShe is shorter than average, with long, fragrent sandy-white hair that hangs at her lower back. \n\nA small pair of round reading glasses with black rims rest on the bridge of her nose.\n\nA gold and topaz earring in each ear. \n\nHer eyes appear almost cat-like and glow with an alluringly pleasant gold.\n\nTattoos: \nTwo small crossed arrows on her right wrist. \nA red rose on the left side of her chest, beneath her collarbone.",
					},
					["4"] = {
						["AC"] = false,
						["TI"] = "Aura",
						["IC"] = "achievment_raid_houroftwilight",
						["TX"] = "Rae bears a moderately potent magical aura.\n\nOther magical users would be able to detect it with ease, and would be able to notet faint traces of arcene energy, but far moreso light energy.\n\nThis aura is granted to her by the grace of the light, and furhermore, as a result of this she radiates a constant, and comfortable warmth.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Satchel",
						["IC"] = "INV_Tailoring_70_SilkweaveImbuedBag",
						["TX"] = "She has a plain brown linen satchel slung over her shoulder, clasped together with a gold buckle.\n\nThe satchel is enchanted to be much larger on the inside and carries all of her essential items. \n\nCurrently carrying: \n\n- Half Empty bottle of cheap wine. \n- A waterskin.\n- A coinpurse.\n- A curved knife.\n- A small bag of dried nuts and fruits.\n- A large, dusty book.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Scars",
						["IC"] = "artifactability_FeralDruid_OpenWounds",
						["TX"] = "On the right side of her head, near her temple, above her ear, are three claw-like scratch marked scars. \n\nThe scars are faded from time, to a light pinkish colour. \n\nWhen attention is drawn to them she will attempt to conceal them with her long hair.",
					},
				},
				["ST"] = {
					["1"] = 2,
					["3"] = 2,
					["2"] = 1,
					["5"] = 0,
					["4"] = 0,
					["6"] = 0,
