				["v"] = 33,
			},
			["time"] = 1603027570,
			["link"] = {
				["Rhymeria-ArgentDawn"] = 1,
			},
			["about"] = {
				["v"] = 80,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Sunlight:512:128}{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n{h3:c}Appearance{/h3}\n\n                            {link*https://pbs.twimg.com/media/DyjJiwAXcAAlKXC.jpg*Art done by @delphadraws on Twitter!}\n\n{col:ffc7e5}Rae, unsurpringly, adhere's to many of the the elven beauty standards that her kin have become renowned for. Her skin is milky pale, and bears next to no blemishes, save for the three obvious scars on the side of her head.\n\nHer hair is long, almost reaching the bottom of her back, and naturally coloured a sandy white. Her hair is silky, and running one's hand through it is as easy as doing so with water. It is incredibly apparent that she takes immense pride in her hair, as it always appears well groomed. \n\nHer eyes, almost cat-like in appearance, are intense when they land upon you. Her cornea's shimmer faintly while a creamy yellow colour, which accentuates her much bolder and shining golden irises. Her eyes are ever so slightly hidden behind a small pair of rounded reading glasses that rest softly on the bridge of her nose, which in of itself can be described as cute and button-like. \n\nHer lips are well defined, full and with a nicely arched Cupid's bow, that producses a genuine-looking smile. \n\nOn each one of the lobes of her long, elven ears lays a studded golden earring with an amber topaz gemstone within them - simple jewelry of no particular significance.\n\nShe doesn't often wear much make-up other than a light foundation to even out her skin tone, and then a light bit of blush just to add colour to her already pale skin.\n\nHer biggest blemish on her entire body sits atop her head. More specicifally on the right side of her head, near her temple, above the ear. There lay three claw mark scars, which have faded to a dull pink over time. However, the scars had left enough of an imprint to warrant hair no longer growing there. She often tries to part her long hair on her right side to cover them, suggesting that she is rather self-concious of them. \n\nHer body is a perfect representation of her varying walks of life. Her upper-middle class childhood opened the doors to many delights such as cakes and other delights, and eventually wine in her young adulthood. These aided in the growth of her noticeable and feminine curves. A larger than average bust, and wide hips.\nWhen she joined the army, however, many of these old habits had to die and make room for strict exercise regimes. This aided in training her body; from the flat-toning of her stomach, to the emergence of strong, fit legs. All without compromising her womanly features. Her time in the army had helped her develop an important excercise ethic, and she routinely exercises to maintain her figure. \n\nLastly, her hands and feet end in finely manicured nails, painted to shimmer with a simple glossy coat of polish{/col}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n\n{h3:c}Personality & Traits{/h3}\n\n{col:ffc7e5}Often, Rae can be viewed as her usual, jovial self. Not fearing to poke fun at her friends with her usual tongue-in-cheek, sassy  attitude. She is not afraid to speak her mind, no matter her company. Should one approach her rudely, however, especially when she is caught off guard reading, she can be quite blunt and viper tongued toward the unfortunate individual. A small amount of courtesy will ensure that one goes a long way with her, helping in revealing the lighter side of her persona.\n\nOne of Raeliah's best traits about her is her loyalty, to her friends and those closest to her. Not thinking twice about doing things for those who have been good to her in the past. And, those within her loyal circle have good reason to be there in her eyes. Her time in the military as well as her priestess initiation has exposed her to a magnitude of different personalities, which has resulted in her becoming quite the good judge of character. A harsh one, at times, some would argue, but she is rather swift to make a judgment about a person after only moment of meeting them.\n\nRae, having come from a well-off family, is well educated and it is reflected in her speech patterns and inflections. She can often come across as having somewhat of a know-it-all personality - especially when it comes to topics she is well read about. It is not entirely uncommon for her to interject a in a conversation with a swift: \"Oh I've read about that!\"{/col}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n\n{img:Interface\\FlavorImages\\BloodElfLogo-small:256:256}",
				},
			},
