						["TX"] = "{h1:c}{col:FF7F00}{icon:ability_hisek_aim:25}If you're going to shoot, shoot. Don't talk.{icon:inv_firearm_2h_rifle_kultirasquest_b_01:25}{/col}{/h1}\n\n",
