						["AC"] = true,
						["TI"] = "Form",
						["TX"] = "\nA tall, broad-shouldered woman whose features are well beyond endowed, and carrying with her scarred flesh from various skirmishes against the enemies of the Horde and those who dare to defy her own personal whims. \n\nRajekra has soft dark-skinned blueberry flesh, and sporting strong forearms accompanied with a pair of chiseled thick abs supported by thick, salacious thighs to maintain that virile figure of the huntress.\n",
