					["5"] = {
						["AC"] = true,
						["TI"] = "OOC",
						["IC"] = "spell_misc_emotionhappy",
						["TX"] = "\nI hope you are having an awesome day, friend. If you have any questions about me, or the character feel free to ask away. I like talking and making new friends.\n\nAm cool with being approached while leveling or out in the city / towns, either through /s or /w!\n\nMight I also add, while this character has very suggestive undertones, I still play her semi seriously!",
					},
					["3"] = {
