						["TI"] = "Face",
						["TX"] = "\nVisage of Rajekra is well recognizable. Angular features, with sharp cheekbones. Her eyes are darkened with an onyx eyeshadow, and her brows given the same treatment. Her tusks carry with them gilded rings at the base, and both of her ears flaunt dozens of golden hoop earrings. A single gilded septim piercing hangs down through her nostrils.\n\nHer voice carries with it a slight flamboyant pitch whenever the woman speaks with some excitement or is cheerful however more often than not her tone carries with it a slight hoarse, smokey sound.",
						["IC"] = "trade_archaeology_highbornesoulmirror",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Endowed",
						["TX"] = "\nIn spite of the strong form of the woman, the troll still manages to maintain endowment worthy of a sculpted bitch. A trunk worthy to kill, and a bosom so hefty that it hangs slightly down her chest.\n\nPrized possession? Ass. Phat, round, apple-curved, mouth-watering piece of troll booty. Salt-drenched and often oiled alike the rest of her flesh, that piece of jiggling troll bottom is a sight to behold.\n",
						["IC"] = "inv_misc_treasurechest04b",
