						["TI"] = "Attire / Weaponry",
						["TX"] = "Her attire is made of sturdy leather. Enough to offer her freedom of movement and some light protection. The only part that isnt made of leather is her cloth headgear, and her iron shoulderpad. Her weapons are nothing else than her two favourite daggers, one is infused with fel magic and the other with blood magic, they are ussually coated with poison, one of Orasis secret mixtures.",
						["IC"] = "Achievement_Boss_AlAkir the Windlord",
