					["3"] = {
						["AC"] = true,
						["TI"] = "Unstable mentality / Weak mind",
						["TX"] = "Orasis mind is very vulnerable to mind reading. Any contact with her mind hurts her and might get her aggressive. Actually, to be more precise, she might get agressive with no reason at all.",
						["IC"] = "Ability_Kaztik_DominateMind",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "General pressence / Aura",
						["TX"] = "Orasi ussually sneaks around when there are lots of people. If she doesnt sneak though, she ussually walks and acts in a carefree style. Orasi speaks with a sweet tone most of the time, yet what she ussually speaks about isnt sweet at all. She doesnt seem to emit any magical aura by default.. sometimes though.. twilight magic.",
						["IC"] = "Ability_Priest_Phantasm",
					},
					["5"] = {
						["IC"] = "achievement_battleground_templeofkotmogu_02_purple",
						["TI"] = "Other details/possessions",
						["TX"] = "She is wearing a small skull-shaped iron amulet around her neck.\n\nA ring made of gold is resting on her right ring finger. Though its hidden most of the time under her glove.. if ever seen it can be identified to have infusion of fel. It is adorned with prismatic diamonds, a lot of them, all embedded in the middle, casting the entire middle part of the ring be made of those gems. Upon closer inspection, a faint shimmer of green can be seen dancing in the golden parts. The ring holds empowering magical properties, along with a special ability. At the inner part of the ring, there is a sentence written in demonic: \"Orasi, i will protect you, forever.\" The words are engraved magically on the ring, offering protection from lesser demonic mind controlling and also lesser demonic attacks.\n\n",
						["AC"] = true,
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Watchful / One eyed",
						["TX"] = "Constantly ready, constantly watching. She is always prepared for a situation, ready to respond even to a sneak on her. Except when she had a drink. And yes, its only one eye, her left eye has a slice on it, all the way from the forehead down her cheek. The iris is white dead.",
						["IC"] = "Ability_Rogue_BloodyEye",
