				},
				["v"] = 71,
			},
			["time"] = 1603147879,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n\nOrasi was raised by her mercenary father alone, since her mother died giving birth. Her father was constantly blaming Orasi for her mothers death, yet he also trained her to fight with all kinds of weapons, axes, swords, bows, anything that could kill would be enough reason for her to learn it. Orasi loved dual wielding her two daggers and she became an expert with them.\n \n\nYears passed, at her 17 she was following her father in assassinations and thievery, her father stopped training her since he saw he couldn't teach her anything more, she had became much more of a better fighter than him.\n\n \n\nHer father grew jealous of her, in his mind, Orasi not only took his love away from him and now she became better than him. He didnt love his daughter and left her one night, alone, in the woods of felwood where they had camped. Orasi woke up one day completelly alone.\n\n \n\nOrasi was left, she didnt know what to do. She felt lost and abandoned. She stayed at the camp that whole day, waiting for her father. Yet he never came and  what little hope she had to find him was lost.\n\n \n\nAt the very next day, she got attacked by a demonic beast, a fel hound. The fel hound ravaged Orasi, almost at the point of killing her. She managed to slay the beast, only out of a purely lucky blind swing of her dagger, but her mentallity was shaken from the demonic attack and her father abandoning her. She left of wounded to find her father.\n\n \n\nFor 2 years she has been searching for her father, and she finally found him alone in his small camp after she heard some rumors from a nearby village. She went close to her father, caressed his cheek while he was sleeping and then whispered \"You will never leave me again\". Saying so, Orasi butchered her father with her knife and left the body there, except his skull, which she carried into her secret lair and placed it on a skull altar she had build the last 2 years. \"I will grow my family, i will bring you all more company, dont worry you sillies, we will all be together forever\"\n\n \n\n\"Forever\"\n\n \n\nOrasi wasnt the same woman anymore. Something changed inside her. She was already killing people for her 'family' altar, to grow it bigger. Yet after she killed her father, she felt alive. She didn't want to hurt more people to take them in her 'family' but she never stopped loving the people she placed in her altar. She stayed away from cities and generally people for a lot of time, not only because she was wanted dead literally everywhere, but also because she started getting attacked every night by demons while out in the open, the demons werent assaulting her when she was in a closed area, in her case, the cave. \n\n \n\n1 year passed without killing or meeting anyone. All this time she started feeling worse and worse, something inside her was pushing her to look at her daggers and use them. 'Kill, you need it' She started to hear a voice in her head. She really felt she needed it, she was afraid of the voice. She didn't knew who or what it was. She refused to kill, over and over again for a whole month, each day the voice getting louder. \"Worthless..\" said the voice. She started feel what the voices wanted her to feel. \"You want to kill. You will kill. You love to kill\" she heard. Orasi smiled and nodded to herself, or the voices she was listening to.\n\n \n\nThat night, she sighted the closest village to her location and murdered one knight, two women and a child. When she finished and took their skulls she snapped back to normal, the daggers fell from her shacking hands as she saw the four skulls infront of her, on the ground. The voices were sated, it wouldnt pester Orasi for now. She took the skulls with her, since she couldnt give them back their lives, she would love them as her own family. The 'family' grew by 4 members that day.\n\n \n\nThe next need to kill came half a year later. She satisfied it.\n\nThe next one 1 month later. She satisfied it.\n\nThe next on a week. She satisfied it.\n\n \n\nHer need to kill became daily very soon. If she didnt kill someone each day, those voices would start pestering her, claiming her body and mind slowly. What are the voices? She never learned, but now, they are part of her.\n\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-ScimitaroftheSirocco:512:256}\n\n\nSpecial features so far:\n\n- Fel infused dagger [The Unexpected] (By Elarise the demon hunter)\n\n- Blood infused dagger [Fin Surfal] (By Elizis the San'layn)\n\n- Enchanced boots, a blinking spell is cast when she is frozen in place, not really good at using the automated blink yet. (By Mal'Thadian)\n\n- Any voice going directly to her head, be it a whisper or a scream, hurts her mind immidiatelly, might get agressive.\n\n- Partially soul burned, permanently weaken her. (By Master Badrok the Warlock)\n\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-ZinRokhDestroyer:512:256}\n\n\nPeople killed and skull collected(Most recent at bottom): \n\n1: Vengy Flowerbloom\n2: Peggy Flowerbloom\n3: Mathew Flowerbloom\n4: Jake Downwarts\n5: Xizvy Rocketboots\n6: Amori Trista\n7: Hedviga Gift\n8: Ponra Manzana\n9: Galvadio Ironhat\n10: Shara Flowerbloom\n\n11: Vale Broom\n12: Gale Broom\n13: Furia Skas\n14: Memosa Lucid\n15: Brandon Lucid\n16: Amalia Lucid\n17: Luna lighting\n18: Marc Blank\n19: Agnes Redblood\n20: William Skyfree\n\n21: Walter Silk\n22: Troye Gutslayer\n23: Henry Country\n24: Petra Stone\n25: Beatrice Molding\n26: Matilda Coronet\n27: Helena Vigor\n28: Hugo Vigor\n29: Thomas Flich\n30: Isabella duvet\n\n31: Gustaf Wild\n32: Patty Hammer\n33: Falstaff Hammer\n34: George Raucous\n35: Penelope Rigid\n36: Eric Viazmos\n37: August Hillborn\n38: Henrieta Mountainpass\n39: Pamela Ignitetorn\n40: Teodor Ignitetorn\n\n41: Antonio Gray\n42: Charlie Král\n43: Morkgor\n44: Bell Borvin\n45: Kenny\n46: Dawn Nelthidy\n47: Fig Endercore\n48: San Brook\n49: Ken Brook\n50: Veindor\n\n51: Aznious Soulburned\n52: Xadrig Weatherer\n53: Sight\n54: Ragmar