				["Rynore-ArgentDawn"] = 1,
			},
			["about"] = {
				["BK"] = 1,
				["T3"] = {
					["PH"] = {
						["TX"] = "Of average height and build, Rynore wouldn't be described as anything remarkable when placed beside any other Blood Elf before the changes brought on by the process of becoming a Demon Hunter.\n\nBuilt like a Farstrider, Rynore appears very dextrous and fit. Her long black hair often hangs in a practical braid over her shoulder or tail down her back and her features; once of fair complexion and typical elven grace, now present themselves with ruinous cracks and marks earned by over indulgence in fel magic. Once soft, her skin looks and feels rough and almost leathery where the demonic influences have begun to take hold which get worse the further away the skin is from the bindings tattood on her body.\n\nIf ever uncovered, Rynore's buring Fel gaze is cast from sunken eyes and accompanied by a seemingly permenant scowl on her cracked lips. \nShe speaks with a hoarse, raspy voice with a distinct lack of tone.\n\n{link*https://imgur.com/a/HDdlonj*Portrait}\n{link*https://imgur.com/a/x6lvZrA*Rynore+Demon}",
						["BK"] = 1,
					},
					["PS"] = {
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "Known to Illidari, Rynore once held the title \"the Ravenous\". She become infamous for stealing kills from other hunters and feeding upon demons in excess to the point where she had become aggressive and unsociable with other hunters. When embarking on hunts, other member sof the Illidari would refuse to work with her.\n\nSince the end of the Legion invasion of Azeroth and their defeat on Argus, Rynore spent only a short amount of time with the other Illidari before leaving their company to serve within the Horde. Towards the end of her service in the Illidari, Rynore showed outbursts of rage and an increase of aggression during spars which lead to some believing she was not properly controlling the Demon within. With assurance that she would check in with the Illidari often to ease their concerns that she was not able to control it, she took her leave to begin her service..\n\nHer check-ins have become less and less frequent to the degree that some amongst the Illidari may consider her a danger at least and at most, a renegade.\n\n--\n\nAmongst Blood Elven nobility, the Firebough name is known as a disavowed household. They were known to have produced nine children in the last generation of their noble standing and were renowned to have been excellent swordsmen. Unmatched with their swordplay in contests and minor skirmishes with the Trolls at the border, House Firebough received numerous summons to commit to the later wars with the Horde. Lord and Lady Firebough refused to commit their sons and daughters, much to the protest of some of their children and heavily contested it until the end of the Second War and well into the Third War until Silvermoon fell. Upon the peoples rebirth into Sin'Dorei, the Firebough name was stripped of its nobility as they were not only remembered as failing to properly contribute to past war efforts but of hoarding resources and putting their own survival above the needs of the nation.",
