		["11292146219ouTY"] = {
			["character"] = {
				["v"] = 97,
				["CO"] = "Open for possibly all kinds of Rp, up for ooc conversations, answers questions - even stupid ones.\n\n\nI hope you're having an evil day today!",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 3,
				["CU"] = "Thinking up an evil plan for today.\n",
