						["AC"] = true,
						["TI"] = "Appearance",
						["TX"] = "Eye: \n\nHer right eye appears to have jaded over and a gray hue over the eye, giving you a clear key that this eye is completely blind, compared to her bright Quel'dorei looking left eye which appears to be prefectly intact.\n\nNo injury appears to be spotted on the blind eye, so one can only assume that this is something within that has caused this.\n\nScars:\n\nAlong her wrists, hands and arms are what appear to be many scars all in the appearance of slices that are about 5-6 inches long and are in different spots along the forearm, wrists and palms of the hard, all seem to have scarred over well however. But why would someone do this to themselves?\n\nPiercings:\n\nOn her lip would be a gold looking ring that pierces the center of the bottom lip, spliting it in two but shines brightly, the area around it looks well taken care of, and the site of the piercing looks clean and well-cared for.\n\nAnother set of piercings would be some stretchers on either side of the ear, quite small for Zandalari stretchers.\n",
