					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Old Spice",
						["TX"] = "In an attempt to mask the savage smell of iron and leather, he wears a strong cologne that smells akin to cinnamon on whatever skin is visible.",
						["IC"] = "inv_valentinecolognebottle",
					},
				},
				["ST"] = {
