					["3"] = {
						["AC"] = true,
						["TI"] = "Leather collar",
						["TX"] = "Upon her neck is a home-made looking small leather collar decorated with tiny silver studs.\nVisible poking out from under the collar lies a bite-shaped scar.",
						["IC"] = "INV_Belt_Leather_DungeonLeather_C_05",
