					["2"] = {
						["AC"] = true,
						["TI"] = "Satchel",
						["TX"] = "A battered satchel is almost always found slung over her shoulder, the contents of it a variety of trash that seems to change by the week. Anything unfortunate enough to be sentenced to spend time in this bag will no doubt make it back out damaged, a lack of care as to how she treats it.\n\nHanging from the strap of the satchel would be a tightly wound necklace. A small wooden heart would dangle from it. ",
						["IC"] = "INV_Misc_Bag_29",
					},
					["5"] = {
						["AC"] = false,
						["TI"] = "Mal's 'Adjusted' Garments",
						["TX"] = "Fitting by no means, the material strained and threatening to tear. (With some tears already growing! Alongside signs of entire sections yanked off.)\nA large scrap of jagged metal dangles as a 'chestplate', crudely strapped on by force and crooked fishing hooks forced into pins.\nTrousers.. Salvaged into repairs. Rest in pieces.",
						["IC"] = "inv_misc_clothscrap_04",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Rough, Torn and Tattered",
