			["about"] = {
				["vote"] = {
					[479822318] = 1,
					[3399697996] = 1,
					[2162909016] = 1,
					[421313748] = 1,
				},
				["TE"] = 1,
				["T1"] = {
					["TX"] = "A shield to some, a wall to others.\nViroz is the muscle of the Shadesworn trio, siblings raised by the harsh reality of the streets. \n\nVisually everything about this one screams one thing; Dishevelled. A mess. Holding herself with not much regard dirt and grime often speckles over her, hair tied back mostly just to keep it out of the way. Under her left eye resides a mole. Under the dirt, past the bruises and scars rests a toned body muscled and almost as sturdy as her unshakeable stubborn attitude. \n\nThis is not without fault though; Viroz suffers from clumsiness that'd make the ogres seem careful. Paired with being recklessly rough objects are often smashed among other things.. Not that she'd admit to it.\nWith a mischevious glint often dancing across her eyes this reckless one is forever testing her limits and irking those around her. \n\nIn their prime the Shadesworn fronted as dealers, their goods ranging from pointless tat to more frowned upon goods peddled in secret. In those days Viroz was not much more than a bodyguard, or as her siblings seemed to think, a meat shield. \nAn attitude formed and molded by her past this one is often at odds with those around her, being unable to regard many as more than an aquaintance. Those who knew her in the past few years may notice her once firm walls starting to crumble down, a vague conscience drilled in by the efforts of a close few. \n\nAs of current Viroz scours over the lands seeking a path that suits her, her lack of skills and a inability to hold back often closing the door on many chances. This means quite the list of past activities; From being a bouncer, fumbling across crews, various stints of mercenary work and undoubtedly a lot more yet to come.\n",
				},
