		["1014123845ZuRFd"] = {
			["character"] = {
				["CU"] = "Clearly uncomfortable, keeping her head down. ",
				["CO"] = "2016 character. \n\nYou are welcome to approach. (You can be hostile.)\n\nArt in about.",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 2,
