			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-BLACKROCKSPIRE:256:128}\n\n{link*https://i.imgur.com/DVulwwQ.jpg*Cristek Portrait}\n\nCristek's skin is a dark shade of green, his eyes burn bright blue. He has ordained his skin with tattoos of the Frostwolf clan, paying homage to his ancestry and affinity with their Lupin Kin. His left arm and neck have heavily scarred from his misadventures with borrowing the flame at a young age, unaware of it's danger. A price he has never forgotten. \n",
						["BK"] = 9,
					},
					["PS"] = {
						["TX"] = "- Emotional, and a deep thinker. Cristek prefers caution over action, believing that any serious consideration of action, one must seek council with the Spirits.\n\n- Racist: Cristek has a dislike for Gnomes, Dwarves and Goblins. He believes their technology has taken them away from balance and nature: Cristek is a Ludite.\n\n- True Believer: Cristek will die for the Horde, He believes the Horde can bring balance to the chaos in the world.\n\n- Scared: While brave in battle, Cristek is truly scared of the duty that rests on his shoulders or any Shaman's shoulders. He recognises the importance of his role and does not want to fail in his duty to himself, the Horde and\nhis guidance of the spirits. \n\n-Experienced Shaman: In his youth, Cristek was a powerful but cautious Shaman, now though he has seen and done many things. More importantly he has conversed and bargained with the elements for a long time. He feels Azeroths pain, and is willing to do anything to maintain the balance.\n",
						["BK"] = 11,
					},
					["HI"] = {
						["TX"] = "Cristek, born to a poor family in Frostwolf Village, a child of Thralls Horde, from a young age found muttering into the flames around him his family quickly gave him to the clans Shamans to teach him the way of the elements. Comparatively young to his peers, he has put his faith in the elements, always heeding their wisdom. Cristek earned his honorary name at the age of 22, saving a wolf from hunters, his affinity with nature quickly made the two inseparable. Spending longer and longer together in Alterac mountains. \n\nTaking part in multiple conflicts against Dwarven incursions, Cristek and his wolf, together became known as the Cinderwolf, due to Cristets affinity and favour of flame and his Auburn wolf 'Red Fang' taking on Soldiers and Scouts with Hammer and Fang alike. \n\nCristek has served the Horde for as long as he can remember, fighting the Alliance and Legion throughout Azeroth and further afield. Never forgetting where he came from or what greater purpose he serves.\n\nHis greatest purpose now, working with the Earthen Ring to undo the damage of Deathwing and calm the spirits of the world. \n\n{h2}Oathbound Hounds{/h2}\n\nIn his Travels around Azeroth and predominantly the Barrens, Cristek ran into what he thought was a band of brigands - but after getting to know their members, learned of the Oath Bound Hounds. A somewhat ragtag group of mercenaries doing their own part for the Horde and for some coin along the way. \n\nWorking with the Hounds - Cristek has travelled across Azeroth; not only helping the Hounds, but continuing to work with the Earthen Ring.\n",
						["BK"] = 1,
					},
