			["time"] = 1603031552,
			["link"] = {
				["Sylineth-ArgentDawn"] = 1,
			},
			["about"] = {
				["v"] = 2,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "I first met the creature called Sylineth just outside the Temple of Elune in Val’sharah, it was not of course by luck that I was meeting him here, other members of my race had noted that like myself he carried with him the symbol of the Highborne house I assumed myself and Grandmother were the last true descendants of this old Suramar family. \n\nI had met quite a few other Nightborne in my adventures through Suramar to trace my lineage, but he was unlike any of those saved by the Arcan’dor. He is still a husk of what would constitute a child of the city of Suramar. He is certainly tall, standing at head with me at Seven and Five, but his form is thin and spindly, were his chest exposed I would have been able to count on the ribs of his torso from hundreds of feet away. But when he spoke, he had a confidence that was borne, not from physical prowess as I possessed, but a deep understanding of things beyond others' measure. \n\nHis skin was a pale off-white tone, almost silver in the twinkling lights of the scattered moonwells that surrounded the small circular area before the temple itself. We both reached out and grabbed each other by the forearm and bowed as I had learned was a traditional greeting for the various offshoots of the Starweaver family. And as I looked deep into the man's face, I saw the permanent reminders that he, like so many of his people had fought back against the legion and had been punished for doing so by his own people. His flesh was drawn tight over his bone structures and the bones themselves seemed to sit off angled to where one would expect them in a Shal’dorei of Suramar. He reminded me so intently of a Nightfallen, that I was sure to ask him that he had feasted upon the fruit of the Arcan’dor, he simply laughed and acknowledged the scars left upon him by his time spent in exile from his home city shortly before the defeat of the Legion. He was a careful man, I could tell. Learned and thoughtful he studied me intently and the fine clothes he wore spoke deeply to me of how well my family had survived in Suramar in the millenia that the shield remained aloft. His eyes twinkled like literal stars from within the sunken sockets, as if creeping out from the deepest portions of the Great Dark Beyond. His ear shot out from his head, and unlike many others of his race, he wore no jewelry upon them, he was also devoid of hair upon his head, and only the faint traces of his arcane tattoos were visible in the twinkling lights of the forest.\n\n-Sylineth as described by his Highborne cousin Sylino. ",
				},
			},
