		["0404183319sYkBe"] = {
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Rus'kah Mask",
						["IC"] = "INV_Archaeology_80_Zandalari_Mask",
						["TX"] = "Vuji has made his own real rus'kah mask with a surprised expression and it is hanging on his belt on the right side of his hip.",
					},
					["3"] = {
						["AC"] = false,
						["TI"] = "Weapons",
