		["1217171923X7RSR"] = {
			["character"] = {
				["v"] = 18,
				["CO"] = "Come say Hi or /w to me ^^\nReforming the Merc guild\n\nArtwork in ArgentArchives. Link on About.",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 3,
				["CU"] = "\"Good leaders inspire by example, but if that fails, brutal violence will do just as well!\"\n\nBruises on top of bruises\n",
			},
			["time"] = 1603044653,
			["zone"] = "Orgrimmar - The Drag",
			["about"] = {
				["v"] = 50,
				["BK"] = 6,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-warrior-cover:256:256} {icon:warrior_skullbanner:25}\n\n{link*https://www.argentarchives.org/node/203758*Argent Archives}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{h3:c}{col:edff95}Immense strength. Personification of endurance and Orc willpower. She-Orc manages to survive uneven odds, even risking her life needlessly, as long as it was a risk that lay along the path to victory!{/col}{/h3}\n{img:Interface\\PVPFrame\\Icons\\prestige-icon-3-1:128:128}\n\n{h3:c}{col:ffe860}Dilldra's muscles are more than defined, they have been densely improved. Her biceps and forearms can be classified as fleshy tree trunks but composed of pure muscle alone, each movement making them appear bigger, impressive in size. \n\nHer voice is ragged, and her heavy breathing impossible to ignore, her inhaling dragging your attention to her large, broad shoulders. On her stomach there is a chiselled, well-formed sixback. Even her chest lacks any fat, making her seem incredibly masculine.\n\nDilldra's rugged face is littered and framed by the scars of her hunts and battles in the wilderness. Her hands are large and hardened.\nShe reeks of sweat and tobacco mixed with gunpowder and blood. Her teeth are yellowish and her mohawk is dark blue.{/col}{/h3}\n\n{img:Interface\\PVPFrame\\Icons\\prestige-icon-3-3:128:128}\n{h3:c}{col:ebe53e}Her personality is a bit more difficult. Dilldra is very rude By default. Sometimes only because she doesn't know any better, or simply by accident. \nShe can be aggressive when the situation demands it, and protective over the people she cares for. Violent, and emotionaly unstable. She can be kind and caring but she rarely shows this trait to anyone but her loving mate and her children.{/h3}\n{img:Interface\\ARCHEOLOGY\\ArchRare-DraenorOrc:512:256}\n",
				},
			},
			["link"] = {
				["Dildra-ArgentDawn"] = 1,
			},
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Stench.",
