		["0926185701gO8Np"] = {
			["character"] = {
				["CU"] = "• Seems to be in a quite positive mood\n\n• Wears his working gear and carries his backpack with him.\n\n• Helmet attached to belt\n",
				["CO"] = "• Might make mistakes, English isn't my native language\n\n• Goblins are the best race, change my mind.\n\n• I like using ™'s\n",
				["RP"] = 1,
