		["[MSP]Orcarona-ArgentDawn"] = {
			["character"] = {
				["CU"] = "Scrounging around",
				["CO"] = "What's mine is mine.\nAnd what's yours is mine too.\n",
				["RP"] = 2,
				["LC"] = "enUS",
				["XP"] = 2,
				["v"] = 3,
			},
			["misc"] = {
				["PE"] = {
					["1"] = {
						["IC"] = "inv_misc_slime_01",
						["TI"] = "Tang of lye",
						["TX"] = "Trixxy is a conscientious rascal, so she takes proper care of her equipment, oftentimes more meticulous then of herself. Therefore her trim shape is more often than not surrounded by a stinging admixture of lye and olive oil that she employs to keep those leathers flexible and the blades untarnished.",
						["AC"] = true,
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Big Brass Bombs",
						["IC"] = "inv_misc_bomb_01",
						["TX"] = "A rotund marvel of exploisive potential strapped to her toolbelt, swaying like a pendulum to the power of momentum as she bolts forth to face new adventures, ready to blast.",
					},
					["3"] = {
						["IC"] = "spell_shadow_summonsuccubus",
						["TI"] = "Devil-may-care",
						["AC"] = true,
						["TX"] = "Dissipated lifestyle is Trixxy's gist, and all the perpetrations she commits serve one single purpose of sustaining the coccoon of revelry around this raffish woman , thus sparing her the pain of tedium. Henceforth the signs of depravity are thick in the air around her, especially when she sheds her utile suit in favor of a more glamorous dress and spruces it up with scentful herbs and garish maquillage, calculated to impress the starved audience.",
					},
					["2"] = {
						["IC"] = "inv_eng_bombslow",
						["TI"] = "Stylish Clip",
						["AC"] = true,
						["TX"] = "Truth be said, Trixxy seldom grows fond enough to develop hard feelings for her \"tools of the trade\" and holds most of the pieces as something little better than temporary disposables. However, one certain element of her accoutrements she never surrenders to negligence; a tiny family relic, shaped in the image of a land mine that she uses as a clip to style her hair or hold her cape.",
					},
				},
				["ST"] = {
