			},
			["about"] = {
				["v"] = 29,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Sandstorm:512:128}\n{h1:c}{col:4ea6c2}Binge Eternal{/col}{/h1}\n\n\n{h3}{icon:ability_rogue_masterofsubtlety:25}{col:4ea6c2}Character{/col}{icon:ability_rogue_masterofsubtlety:25}{/h3}\nTrixxy is a dashing charlatan who cuts through misadventures of others like a hot knife through butter {col:ff00ff}(she oftentimes also embodies the very causation of the said misadventures, but that's just a trivia){/col}. She associates with Ravenholdt, but only truly confides in the holy trinity of \"Me Myself & I\". Needless to say that the lapse of moral reservations and empathy due to her being a jovial, yet misanthropic sociopath resulted in steady accustomization to the lifestyle of excessive spendthrift and indiscriminate binge. And she expects the poor \"sources\" of many precious resources she fuels her \"saus und braus\" swing with to stand and deliver like the timid flock of sheep they are, whenever she poises a demand.",
				},
