		["[MSP]Alirah-ArgentDawn"] = {
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Sunlight:512:128}\n{p:c}Still WiP{/p}\n\n\n{h1:c}{col:fffa00}Alirah ,,Angel'' Crimsonflame{/col}{/h1}\n\n{h1:c}{col:ff0800}Life in the hell{/col}{/h1}\n\n{p:c}{col:fffa00}Alirah was born is Quel'Thalas like every other elf. She had a perfect family. Her father named {col:ff0200}Thal'Rael Crimsonflame{/col}{col:fffa00}, a strong and brave warrior, her mother was {col:ff0200}Shel'arah Dawnfeather{/col}{col:fffa00}, she was a priest. Angel had a sibling, an older brother named {col:ff0200}Etheral Crimsonflame{/col}{col:fffa00}, the family's ranger. She was the youngest, a beginner priest. Her mother always teached her something new. The whole family was close to each other. They lived happily in the city until the day when Arthas payed a visit to the city. Everyone fought for their home. The father and brother was in different divisions, only Alirah's mother was with her to help her through in this. The two healed the injured elves day and night without any rest. They was so tired in the end. Those who came out alive went back to the city. Angel and her mother found {col:ff0200}Thal'Real{/col}{col:fffa00} and healed him. Now the three tried to find the lost child. So many days passed, so many dead elf came back to the families to take the last goodbye. {col:ff0200}Etheral{/col}{col:fffa00}'s body came on the last day. A raised, dead death knight. Arthas killed him, raised him and then he died again. The whole family lost the will to live. The sorrow took over their days and nights. They moved to Dalaran with hope in their heart for a better life. But... It never came...{/col}{/p}",
				},
