					["3"] = {
						["AC"] = true,
						["TI"] = "Features",
						["TX"] = "Angel has an angelic face. Golden, shiny eyes. Pretty freckles. A scar across her right eye (Sight still perfect). She has really light coloured blonde hair, almost white and really long, of course well cared. Under her right eye the people can find a black feather tattoo. She has a golden highlight in her hair on the right side. Of course she has piercing in her tongue, eyebrows, has a septum and both ears pierced. She has shiny golden runes on her right upper arm. She has a light vanilla scent. Next to all this she has really kind calm and soft voice.\n\nMakeup:\nAngel uses some makeup like every girl. She has black and gold eyeshadow, cattish eyelinder and long eyelashes. Her lips has a light pink colour, shiny lip gloss.\n\nNails:\nAngel has not too long gold and black fake nails. Her ring fingers are black, they has a golden feather decoration. Every other finger are golden coloured.\n\nHey.. She is a fighter, but still a woman.",
