		["0817011739f4xxv"] = {
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = false,
						["TI"] = "Aura:",
						["TX"] = "Genuinely eye candy candy to the blind. Even the most unsapient passer by would make the clear cut evidence that Eliseria was something of a spell-chucker. Her aura, if scrutinized through third-world perceptions such as divination or the abhorred utilization of spectral discernment, sanctioned you to perceive that yes, the woman had such an ergo of Light, and Arcane about her persona that you could fill a vial with it and call it a mana potion. This comes with both age, cognizance in the field, and her race --- the High Elves. Perhaps the most true race to the art, as they are the ones inclined to do anything and everything to balance chaos and harmony these mystical artforms. For any average Joe,Eliseria  was a typical Elf; mana-doting. But to a trained ocular perceiver, the woman held far more potential than just a priest-girl.\",",
						["IC"] = "spell_holy_improvedresistanceauras",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Her;",
						["TX"] = "Of the most subtle, carnal desire --- easily deduced would it be that upon first-glance of the Highborne Successor; she was a pinnacle of resplendence. Yes, even the straightest of woman would acknowledge that she at least looked eloquent.\n\n Elves typically carry about them a feminine bravado, though Airysa  had these traits, it was nothing to shy her away from being benevolent.\n\n Her hair was a golden almost platinum hue, which was often slotted to cover her golden  sockets, which peered out into unsuspecting turf with pride and wanderlust. \n\nHer build would be described as sinewy, or perhaps lethally average. While scrawny, it had such a chorus for progression that it beseeches to be inspected further.",
						["IC"] = "inv_helm_flowercrown_a_01_blue",
					},
					["3"] = {
						["AC"] = false,
						["TI"] = "Attire:",
						["TX"] = "Humbly so did the Quel'dorei before you don such incredibly lackluster attire. It was fashioned for warmer climates, as the wool that made up her suit was quite cumbersomely, dragging about in hefty-looking fashion, and surprisingly well-kept. Not a spot of dirt or oil was visible -- free of any stain otherwise. While it is typical for her kind to gasconade their fashion tastes by sporting sumptuous goods, jewelery, or by the Sunwell, nothing at all; Eliseria digressed that visually so. It was mere linen, wool, and if inspected by a meticulous hand, flakes of Arcanite dust, which pocked the fabric so well that you wouldn't dare befit this for just any chap. Nay, this attire suited a Human well. Though on an Elf? It did not look bad, at all.",
						["IC"] = "trade_archaeology_queenazshara dressinggown",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Jewellery",
						["TX"] = "Lavalier Fashioned into a necklace, cohered by a marginally rusted chain, would be a fragmented childhood memento passed down to Airysa. This necklace held Arcane properties if scryed upon by those with the third-dimensional visual perception that she carried as a Magus.\n\n While it seemed to accommodate no purpose outside of being a very visibly aged keepsake, it lucidly presented a great deal of honour to the woman that he would wear it in a jewelry form. Of a very finely made band of pure gold, dotted with a blue gemstone in the centre, the value of this item was both material and metaphorical. It was a very obvious marital or fashion garment, and was worn on her right hand. It did, however, seem engraved. Perhaps a snoop would warrant it further inspection.",
