		["0307233434LzZST"] = {
			["PE"] = {
				["1"] = {
					["AC"] = true,
					["TI"] = "M.E.C.H.A.S XLR",
					["IC"] = "T_RobotIcon",
					["TX"] = "Mechanised \nElectrostatic \nCritical\nHyper \nAttack \nSystem\neXtra Large Robot ",
				},
				["3"] = {
